// src/components/Contact.js
import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <section className="contact">
      <h2>Contact Me</h2>
      <p>Email me at: <a href="mailto:example@email.com">example@email.com</a></p>
      <p>Find me on <a href="https://medium.com/@hasini.miryala7585">LinkedIn</a> or <a href="https://medium.com/@hasini.miryala7585">GitHub</a></p>
    </section>
  );
};

export default Contact;
